import React from "react";

export default function OrderStatus({ data }) {
  return (
    <div className="order-status">
      <h3>Order Created</h3>
      <p><strong>ID:</strong> {data.orderId}</p>
      <p><strong>Status:</strong> {data.status}</p>
    </div>
  );
}
